import React from "react";
import { Pie } from "react-chartjs-2"

const product = (props) => (
    <div>
        <h1>{props.name}</h1>
        <Pie data={{
            labels:["Fat", "Carbohydrates", "Protein"],
            data: [props.fatCalories,props.carborydratesCalories, props.proteinCalories]
        }}/>
    </div>
)

export default product
